import React, { useState, useEffect } from "react";
// import "./productStyle.css";
import { Link } from "react-router-dom";
import Swal from "sweetalert2";

import {
  Navbar,
  Spinner,
  Card,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  CardLink,
} from "reactstrap";
import axios from "axios";
import FilterAddmember from "./FilterAddmember";

function Teams() {
  const [Teamstate, setTeamstate] = useState(null);

  const DeletePersonFunc = (Teamstate) => {
    Swal.fire({
      title: `You are About to Delete ${Teamstate.name} Are Sure ? `,
      showCancelButton: true,
    }).then((Data) => {
      if (Data.isConfirmed) {
        axios.delete(
          `https://gleaming-goat-sneakers.cyclic.app/team/${Teamstate.Myid}`
        );
      } else {
        return;
      }
    });
  };

  useEffect(() => {
    async function fetching() {
      await fetch("https://gleaming-goat-sneakers.cyclic.app/team")
        .then((res) => res.json())
        .then((json) => {
          setTeamstate(json);
        });
    }
    fetching();
  }, []);

  return (
    <div className="Repo" style={{ color: "black" }}>
      {console.log(Teamstate)}
      <Navbar className="my-1" color="dark" dark>
        <Link to="/">Back to Home</Link>
      </Navbar>

      <div className="container">
        {Teamstate == null ? (
          <Spinner size="sm">
            <h3>Loading...Data</h3> <br /> <h4>No data To show</h4>
          </Spinner>
        ) : (
          <div>
            <ul className="unOrderList">
              {Teamstate.map((v, i) => (
                <Card
                  key={i}
                  style={{
                    width: "20rem",
                    height: "26rem",
                    backgroundColor: "black",
                    margin: "5px",
                    color: "whitesmoke",
                    wordBreak: "break-word",
                    letterSpacing: "1px",
                    textAlign: "center",
                    fontFamily: "arial",
                    fontSize: "15px",
                    borderRadius: "20px",
                    border: "2px solid gray",
                  }}
                >
                  <CardBody
                    style={{ textAlign: "center", marginBottom: "50px" }}
                  >
                    <img
                      alt="Card cap"
                      className="img"
                      src={v.pic}
                      width="100%"
                    />
                    <CardText style={{ color: "blueviolet" }}>
                      {v.name}
                    </CardText>
                    <CardText>{v.Account}</CardText>

                    <CardSubtitle className="mb-2 text-muted" tag="h6">
                      {v.sfid}
                    </CardSubtitle>
                  </CardBody>
                  <CardBody>
                    <CardText>{v.email}</CardText>

                    <CardLink style={{ color: "gray" }}></CardLink>
                  </CardBody>
                  <button onClick={() => DeletePersonFunc(v)}>Delete</button>
                </Card>
              ))}
            </ul>
            <FilterAddmember data={Teamstate} />;
          </div>
        )}
      </div>
    </div>
  );
}

export default Teams;
